import React from "react";
import styled from "styled-components";
import { WholeWrapper, Wrapper } from "../../components/commonComponents";
import Theme from "../../components/Theme";

const Title = styled.h1`
  font-size: 4.5rem;
  color: ${Theme.white_C};
  line-height: 0.7;
`;

const Css = () => {
  return (
    <WholeWrapper>
      <Wrapper
        height={`100vh`}
        bgImg={`url("https://4leaf-bird-s3.s3.ap-northeast-2.amazonaws.com/thumb/image1.png")`}
      >
        <Title>Welcome to Mountain</Title>
        <Title>Expeditions Club!</Title>

        <Wrapper>Overseas Expeditions, UK Mountain Challenges</Wrapper>
        <Wrapper>Private Guiding & Instruction</Wrapper>
      </Wrapper>
    </WholeWrapper>
  );
};

export default Css;
